import React, { Component } from 'react';
import { Box } from './Box';

export class Main extends Component {
    constructor(props) {
        super(props);
    }

  render() {
    let allMyBoxes = [];
    for (var i = 0; i < 100; i++) {
      allMyBoxes.push(<Box></Box>);
    }
    return (
      <div> 
            <h1>I hate this shit.</h1>
          {allMyBoxes}
            </div>);

  }
}
